import React from 'react';
import {Switch, Route} from "react-router";
import {ADD_ROPES_IN_STOCK_PAGE, ROPES_IN_STOCK_PAGE} from "./const";
import AddProductsPage from "../Pages/AddProductsPage/AddProductsPage";
import RopesInStock from "../Pages/RopesInStock/RopesInStock";
import Header from "../Components/Header/Header";
import {BrowserRouter} from "react-router-dom";

const AppRoutes = () => {
    return (
        <>
            <Header/>
            <div>
                <BrowserRouter>
                    <Switch>
                        <Route component={AddProductsPage} exact path={ADD_ROPES_IN_STOCK_PAGE}/>
                        <Route component={RopesInStock} exact path={ROPES_IN_STOCK_PAGE}/>
                    </Switch>
                </BrowserRouter>

            </div>
        </>
    );
};

export default AppRoutes;
